SELECT IFNULL(ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0) - IFNULL(SUM(sales_items_taxes.tax), 0), ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0)) AS subtotal, IFNULL(SUM(sales_items_taxes.tax), 0) AS tax, IFNULL(ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0), ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0) - IFNULL(SUM(sales_items_taxes.tax), 0)) AS total, SUM(sales_items.item_cost_price * sales_items.quantity_purchased) AS cost, (IFNULL(ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0) - IFNULL(SUM(sales_items_taxes.tax), 0), ROUND(SUM(CASE WHEN sales_items.discount_type = 0 THEN sales_items.item_unit_price * sales_items.quantity_purchased * (1 - sales_items.discount / 100) ELSE sales_items.item_unit_price * sales_items.quantity_purchased - sales_items.discount END), 0)) - SUM(sales_items.item_cost_price * sales_items.quantity_purchased)) AS profit, DATE(sales.sale_time) AS sale_date, SUM(sales_items.quantity_purchased) AS quantity_purchased, COUNT(DISTINCT sales.sale_id) AS sales
FROM `ospos_sales_items` AS `sales_items`
